import NumberInput from "../util/NumberInput";

export default function CashPayment(props) {
    return(
        <div className="CashPayment">
            {"Bar-Einzahlung: "} <NumberInput value={props.in} setValue={props.setIn} />
            {"Bar-Auszahlung: "} <NumberInput value={props.out} setValue={props.setOut} />
        </div>
    );
}
